import React from 'react'

const Simply = () => {
    const fruits = ["Apple", "Banana","Grapes","Pomegranate","Custard Apple"]
  return (
    <>
    <ul>
        
            {fruits.map((fruit,index)=>{
               
             return <li key={index}>{fruit}</li>
        })}
    </ul>
    </>
  )
}

export default Simply;
